    NOMBRE_CLIENTE : '',
    MONEDA_ID: 0,
    NOMBRE_MONEDA: '',
    COND_PAGO_ID: 0,
    NOMBRE_CONDICION: '',
    EMAIL: '',
    RFC_CURP: '',
}));
